import React from 'react'

const Login = () => {



  return (
    <div>
      <form onSubmit={handleSignIn}> 
            <input 
            type="email"
            name="email"
            value={credentials.email}
            onChange={handleChange}
            />
            <input 
            type="password"
            name="password"
            value={credentials.password}
            onChange={handleChange}
            />
            <button>Submit</button>
        </form>
    </div>
  )
}

export default Login
